// Sample saved items (you can replace this with real data from a database)
const savedItems = [
    {
        id: 1,
        title: "Summer Vacation",
        description: "A beautiful vacation in the Maldives.",
        imageUrl: "data:image/jpeg;base64,",
    },
    {
        id: 2,
        title: "Mountain Trekking",
        description: "An unforgettable journey to the Himalayas.",
        imageUrl: "data:image/jpeg;base64,",
    },
    {
        id: 3,
        title: "Beach Party",
        description: "Fun-filled day at the beach with friends.",
        imageUrl: "data:image/jpeg;base64,",
    }
];

// Function to display saved items
function displaySavedItems() {
    const savedItemsContainer = document.getElementById('savedItemsContainer');
    savedItemsContainer.innerHTML = ''; // Clear existing items

    savedItems.forEach(item => {
        const savedItemElement = document.createElement('div');
        savedItemElement.classList.add('saved-item');
        
        savedItemElement.innerHTML = `
            <img src="${item.imageUrl}" alt="${item.title}">
            <div class="saved-item-content">
                <h3>${item.title}</h3>
                <p>${item.description}</p>
                <button class="remove-saved-btn" onclick="removeSavedItem(${item.id})">Remove Saved</button>
            </div>
        `;

        savedItemsContainer.appendChild(savedItemElement);
    });
}

// Function to remove an item from saved items
function removeSavedItem(itemId) {
    const itemIndex = savedItems.findIndex(item => item.id === itemId);
    if (itemIndex !== -1) {
        savedItems.splice(itemIndex, 1); // Remove the item
        displaySavedItems(); // Re-display the saved items
    }
}

// Initial display
displaySavedItems();
